    $(this).keyup(function(event)
    {
        if (event.which == 112)
        {
            window.location = '<?php echo base_url()."transaction/wholesale"; ?>';
        }
        
        if (event.which == 113)
        {
            window.location = '<?php echo base_url()."reports/wholesale"; ?>';
        }
    });
    
    $("#search_menu").autocomplete({
            url: '<?php echo base_url(); ?>transaction/search?output=json',
            sortFunction: function(a, b, filter) {
                var f = filter.toLowerCase();
                var fl = f.length;
                var a1 = a.value.toLowerCase().substring(0, fl) == f ? '0' : '1';
                var a1 = a1 + String(a.data[0]).toLowerCase();
                var b1 = b.value.toLowerCase().substring(0, fl) == f ? '0' : '1';
                var b1 = b1 + String(b.data[0]).toLowerCase();
                if (a1 > b1) {
                    return 1;
                }
                if (a1 < b1) {
                    return -1;
                }
                return 0;
            },
            showResult: function(data, value) {
                return '<span style="z-index: 2000;">' + data + '</span>';
            },
            onItemSelect: function(item) {
                window.location = '<?php echo base_url(); ?>'+item.data;
            },
            mustMatch: true,
            maxItemsToShow: 5,
            selectFirst: false,
            autoFill: true,
            selectOnly: true,
            remoteDataType: 'json'
        });
});
</script>
<script>
    $(document).foundation();
</script>
</body>
</html>

